function initResultTable(){const e=document.querySelector(".table-results");if(!e)return;const t=document.querySelector(".do-displayCompact");t.addEventListener("click",()=>{t.classList.contains("is-active")?(t.classList.remove("is-active"),e.classList.remove("table-results__compact")):(t.classList.add("is-active"),e.classList.add("table-results__compact"))});const s=document.querySelector(".do-displayRelevant"),l=[].slice.call(document.querySelectorAll(".table-results tbody tr"));s.addEventListener("keyup",()=>{const e=parseFloat(s.value)||1;l.forEach(t=>{t.classList.remove("is-hidden");const s=t.querySelector(".table-results__p");s?parseFloat(s.innerText)<=e||t.classList.add("is-hidden"):t.previousElementSibling.classList.contains("is-hidden")&&t.classList.add("is-hidden")})})}document.addEventListener("DOMContentLoaded",()=>{initResultTable(),[].slice.call(document.querySelectorAll(".detail[data-file]")).forEach(e=>{let t=e.dataset.file.split("/");e.querySelector(".detail__value").innerText=t[t.length-1]})});